import NavBar from "./NavBar"
import "./All.css"
import Dashbord from "./Dashbord"
import { useState } from "react"

const data = {
    login: {
        title: "Login",
        data: 'Dashbord'
    },
    logout: {
        title: "Logout"
    },
}


function Main() {
    const [value, setvalue] = useState(data.login)
    const logBtn = () => {
        
        setvalue(data.logout)
    }
    return (
        <div className="mainsection">
            <NavBar data={value} logBtn={logBtn} />
            <Dashbord />
        </div>
    )
}
export default Main
